import React from "react";
import { NavLink } from "react-router-dom";
import headerStyle from "../../styles/header/HeaderStyle";
import globalStyles from "../../styles/global/Global";

const Header = () => {
  const activeStyleLink = { color: "blue" };

  return (
    <div className="container" style={globalStyles.containerWrapper}>
      <nav>
        <ul style={headerStyle.ulStyle}>
          <li style={headerStyle.liStyle}>
            <NavLink
              to="/"
              style={headerStyle.aStyle}
              activeStyle={activeStyleLink}
              exact
            >
              Home
            </NavLink>
          </li>
          <li style={headerStyle.liStyle}>
            <NavLink
              style={headerStyle.aStyle}
              to="/covid"
              activeStyle={activeStyleLink}
            >
              Covid
            </NavLink>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Header;
